import Vue from 'vue'
import VueRouter from 'vue-router'
import NavBar from './layout/NavbarTest.vue';
// import Hello from './components/HelloWorld.vue';

Vue.use(VueRouter)


const routes = [
  {
    path: '/',
    name: 'Nav',
    component: NavBar
  },
]

const router = new VueRouter({
  mode: 'history',
  base: '/',
  routes
})
export default router
